  //     defaultProduct = product;
  //     setOpen(true);
  //   }
  // };

  // const handleConfirm = () => {
  //   editProductDetails(defaultProduct);
  //   setOpen(false);
  // };

  // const editProductDetails = async () => {
  //   await editProduct(product, productId);
  //   navigate("/");
  // };

  // const validate = () => {
  //   let temp = {};
  //   temp.productName =
  //     product.productName.length !== 0 ? "" : "Product name is required";
  //   temp.productOwnerName =
  //     product.productOwnerName.length !== 0
  //       ? ""
  //       : "Product Owner name is required";
  //   temp.developers =
  //     product.developers.length >= 1
  //       ? ""
  //       : "Atleast 1 developer needs to be selected";
  //   temp.scrumMasterName =
  //     product.scrumMasterName.length !== 0
  //       ? ""
  //       : "SCRUM Master name is required";
  //   setErrors({ ...temp });
  //   return Object.values(temp).every((value) => value.length === 0);
  // };

  return (
    <Container>
      <Typography variant="h4">Update Paint Inventory</Typography>
      <br />
      <FormControl>
        <TextField
          label="Color"
          variant="standard"
          name="color"
          value={paint.color}
          disabled
        />
      </FormControl>
      <FormControl>
        <TextField
          id="outlined-number"
          label="Quantity in Litres"
          type="number"
          onChange={(e) => onValueChange(e)}
          name="quantity"
          value={paint.quantity}
        />
      </FormControl>

      <FormControl>
        <InputLabel id="demo-single-select-label">Status</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={status}
          label="Status"
          onChange={handleChange}
        >
          <MenuItem value="Running Low">Running Low</MenuItem>
          <MenuItem value="Available">Available</MenuItem>
          <MenuItem value="Out of Stock">Out of Stock</MenuItem>
        </Select>
      </FormControl>

      
      <FormControl>
        <Button variant="contained" onClick={(e) => handleClick(paint)}>
          Save Changes
        </Button>
      </FormControl> 
      </Container>
  );
};

export default EditPaint;
